void DisplayAstrick(int num){
	int x=12;
	for(int i=0; i < num; i++){
		int newX = x*i +20;
		ST7735_DrawBitmap(newX, 71, astrick, 10, 10);
	}
}

void RemoveAstrick(int num)
{
	int x=12;
	int newX = x*num +20;
	ST7735_FillRect(newX, 60, 10, 14,0x0000);
}
